SET FOREIGN_KEY_CHECKS=0;
-- ----------------------------
-- Table structure for npc_data
-- ----------------------------
CREATE TABLE `npc_data` (
  `id` int(11) NOT NULL default '0',
  `name` varchar(255) NOT NULL default 'nobody',
  `life` int(11) NOT NULL default '0',
  `walkspeed` int(11) NOT NULL default '0',
  `runspeed` int(11) NOT NULL default '0',
  `drivespeed` int(11) NOT NULL default '0',
  `weapon` int(11) NOT NULL default '0',
  `subweapon` int(11) NOT NULL default '0',
  `level` int(11) NOT NULL default '0',
  `hp` int(11) NOT NULL default '0',
  `attackpower` int(11) NOT NULL default '0',
  `hitpower` int(11) NOT NULL default '0',
  `defense` int(11) NOT NULL default '0',
  `strength` int(11) NOT NULL default '0',
  `evasion` int(11) NOT NULL default '0',
  `attackspeed` int(11) NOT NULL default '0',
  `AI` int(11) NOT NULL default '0',
  `exp` int(11) NOT NULL default '0',
  `dropid` int(11) NOT NULL default '0',
  `money` int(11) NOT NULL default '0',
  `item` int(11) NOT NULL default '0',
  `tab1` int(11) NOT NULL default '0',
  `tab2` int(11) NOT NULL default '0',
  `tab3` int(11) NOT NULL default '0',
  `specialtab` int(11) NOT NULL default '0',
  `attackdistance` int(11) NOT NULL default '0',
  `aggresive` int(11) NOT NULL default '0',
  `shp` int(11) NOT NULL default '0',
  `dialog` int(11) NOT NULL default '0',
  `eventid` int(11) NOT NULL default '0',
  `askills` varchar(20) NOT NULL default '0|0|0|0',
  `bskills` varchar(20) NOT NULL default '0|0|0|0',
  `dskills` varchar(20) NOT NULL default '0|0|0|0',
  `sigskill` int(11) NOT NULL default '0',
  `delayskill` int(11) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

